searchIndex['yup-oauth2'] = {"items":[[0,"","yup-oauth2","This library can be used to acquire oauth2.0 authentication for services.\nAt the time of writing, only one way of doing so is implemented, the [device flow](https://developers.google.com/youtube/v3/guides/authentication#devices), along with a flow \nfor [refreshing tokens](https://developers.google.com/youtube/v3/guides/authentication#devices)",null,null],[3,"DeviceFlow","","Implements the [Oauth2 Device Flow](https://developers.google.com/youtube/v3/guides/authentication#devices)\nIt operates in two steps:\n* obtain a code to show to the user\n* (repeatedly) poll for the user to authenticate your application",null,null],[3,"PollInformation","","Contains state of pending authentication requests",null,null],[12,"user_code","","Code the user must enter ...",0,null],[12,"verification_url","","... at the verification URL",0,null],[12,"expires_at","","The `user_code` expires at the given time\nIt's the time the user has left to authenticate your application",0,null],[12,"interval","","The interval in which we may poll for a status change\nThe server responds with errors of we poll too fast.",0,null],[12,"server_message","","The message given by the server while polling it,\nusually not relevant to the user or the application",0,null],[3,"RefreshFlow","","Implements the [Outh2 Refresh Token Flow](https://developers.google.com/youtube/v3/guides/authentication#devices).",null,null],[3,"Token","","Represents a token as returned by OAuth2 servers.",null,null],[12,"access_token","","used when authenticating calls to oauth2 enabled services.",1,null],[12,"refresh_token","","used to refresh an expired access_token.",1,null],[12,"token_type","","The token type as string - usually 'Bearer'.",1,null],[12,"expires_in","","access_token will expire after this amount of time.\nPrefer using expiry_date()",1,null],[12,"expires_in_timestamp","","timestamp is seconds since epoch indicating when the token will expire in absolute terms.\nuse expiry_date() to convert to DateTime.",1,null],[3,"ApplicationSecret","","Represents either 'installed' or 'web' applications in a json secrets file.\nSee `ConsoleApplicationSecret` for more information",null,null],[12,"client_id","","The client ID.",2,null],[12,"client_secret","","The client secret.",2,null],[12,"token_uri","","The token server endpoint URI.",2,null],[12,"auth_uri","","The authorization server endpoint URI.",2,null],[12,"redirect_uris","","",2,null],[12,"client_email","","The service account email associated with the client.",2,null],[12,"auth_provider_x509_cert_url","","The URL of the public x509 certificate, used to verify the signature on JWTs, such\nas ID tokens, signed by the authentication provider.",2,null],[12,"client_x509_cert_url","","The URL of the public x509 certificate, used to verify JWTs signed by the client.",2,null],[3,"ConsoleApplicationSecret","","A type to facilitate reading and writing the json secret file\nas returned by the [google developer console](https://code.google.com/apis/console)",null,null],[12,"web","","",3,null],[12,"installed","","",3,null],[3,"NullStorage","","A storage that remembers nothing.",null,null],[3,"MemoryStorage","","A storage that remembers values for one session only.",null,null],[12,"tokens","","",4,null],[3,"Authenticator","","A generalized authenticator which will keep tokens valid and store them.",null,null],[3,"DefaultAuthenticatorDelegate","","Uses all default implementations by AuthenticatorDelegate, and makes the trait's\nimplementation usable in the first place.",null,null],[4,"PollResult","","Encapsulates all possible results of a `poll_token(...)` operation",null,null],[13,"Error","","Connection failure - retry if you think it's worth it",5,null],[13,"AuthorizationPending","","See `PollInformation`",5,null],[13,"Expired","","indicates we are expired, including the expiration date",5,null],[13,"AccessDenied","","Indicates that the user declined access. String is server response",5,null],[13,"AccessGranted","","Indicates that access is granted, and you are done",5,null],[4,"RefreshResult","","All possible outcomes of the refresh flow",null,null],[13,"Error","","Indicates connection failure",6,null],[13,"Refused","","The server did not answer with a new token, providing the server message",6,null],[13,"Success","","The refresh operation finished successfully, providing a new `Token`",6,null],[4,"FlowType","","All known authentication types, for suitable constants",null,null],[13,"Device","","[device authentication](https://developers.google.com/youtube/v3/guides/authentication#devices)",7,null],[4,"Retry","","A utility type to indicate how operations DeviceFlowHelper operations should be retried",null,null],[13,"Abort","","Signal you don't want to retry",8,null],[13,"After","","Signals you want to retry after the given duration",8,null],[11,"type_id","","",9,{"inputs":[{"name":"deviceflow"}],"output":{"name":"flowtype"}}],[11,"eq","","",0,{"inputs":[{"name":"pollinformation"},{"name":"pollinformation"}],"output":{"name":"bool"}}],[11,"ne","","",0,{"inputs":[{"name":"pollinformation"},{"name":"pollinformation"}],"output":{"name":"bool"}}],[11,"fmt","","",0,{"inputs":[{"name":"pollinformation"},{"name":"formatter"}],"output":{"name":"result"}}],[11,"clone","","",0,{"inputs":[{"name":"pollinformation"}],"output":{"name":"pollinformation"}}],[11,"clone","","",5,{"inputs":[{"name":"pollresult"}],"output":{"name":"pollresult"}}],[11,"default","","",5,{"inputs":[{"name":"pollresult"}],"output":{"name":"pollresult"}}],[11,"new","","# Examples\n```test_harness\nextern crate hyper;\nextern crate \"yup-oauth2\" as oauth2;\nuse oauth2::DeviceFlow;",9,{"inputs":[{"name":"deviceflow"},{"name":"c"}],"output":{"name":"deviceflow"}}],[11,"request_code","","The first step involves asking the server for a code that the user\ncan type into a field at a specified URL. It is called only once, assuming\nthere was no connection error. Otherwise, it may be called again until \nthe state changes to `PollResult::AuthorizationPending`.\n# Arguments\n* `client_id` & `client_secret` - as obtained when [registering your application](https://developers.google.com/youtube/registering_an_application)\n* `scopes` - an iterator yielding String-like objects which are URLs defining what your \n             application is able to do. It is considered good behaviour to authenticate\n             only once, with all scopes you will ever require.\n             However, you can also manage multiple tokens for different scopes, if your \n             application is providing distinct read-only and write modes.\n# Handling the `PollResult`\n* will panic if called while our state is not `PollResult::Error` \n  or `PollResult::NeedToken`\n# Examples\nSee test-cases in source code for a more complete example.",9,{"inputs":[{"name":"deviceflow"},{"name":"str"},{"name":"str"},{"name":"i"}],"output":{"name":"requestresult"}}],[11,"poll_token","","If the first call is successful, which is expected unless there is a network problem,\nthe returned `PollResult::AuthorizationPending` variant contains enough information to \npoll within a given `interval` to at some point obtain a result which is \nnot `PollResult::AuthorizationPending`.\n# Handling the `PollResult`\n* call within `PollResult::AuthorizationPending.interval` until the variant changes. \n  Keep calling as desired, even after `PollResult::Error`.\n* Do not call after `PollResult::Expired`, `PollResult::AccessDenied` \n  or `PollResult::AccessGranted` as the flow will do nothing anymore.\n  Thus in any unsuccessful case, you will have to start over the entire flow, which\n  requires a new instance of this type.",9,{"inputs":[{"name":"deviceflow"}],"output":{"name":"pollresult"}}],[11,"new","","",10,{"inputs":[{"name":"refreshflow"},{"name":"c"}],"output":{"name":"refreshflow"}}],[11,"refresh_token","","Attempt to refresh the given token, and obtain a new, valid one.\nIf the `RefreshResult` is `RefreshResult::Error`, you may retry within an interval\nof your choice. If it is `RefreshResult::Refused`, your refresh token is invalid\nor your authorization was revoked. Therefore no further attempt shall be made, \nand you will have to re-authorize using the `DeviceFlow`",10,{"inputs":[{"name":"refreshflow"},{"name":"flowtype"},{"name":"str"},{"name":"str"},{"name":"str"}],"output":{"name":"refreshresult"}}],[11,"encode","","",1,{"inputs":[{"name":"token"},{"name":"__s"}],"output":{"name":"result"}}],[11,"decode","","",1,{"inputs":[{"name":"token"},{"name":"__d"}],"output":{"name":"result"}}],[11,"fmt","","",1,{"inputs":[{"name":"token"},{"name":"formatter"}],"output":{"name":"result"}}],[11,"eq","","",1,{"inputs":[{"name":"token"},{"name":"token"}],"output":{"name":"bool"}}],[11,"ne","","",1,{"inputs":[{"name":"token"},{"name":"token"}],"output":{"name":"bool"}}],[11,"clone","","",1,{"inputs":[{"name":"token"}],"output":{"name":"token"}}],[11,"expired","","Returns true if we are expired.",1,{"inputs":[{"name":"token"}],"output":{"name":"bool"}}],[11,"expiry_date","","Returns a DateTime object representing our expiry date.",1,{"inputs":[{"name":"token"}],"output":{"name":"datetime"}}],[11,"set_expiry_absolute","","Adjust our stored expiry format to be absolute, using the current time.",1,{"inputs":[{"name":"token"}],"output":{"name":"token"}}],[11,"as_slice","","Converts itself into a URL string",7,{"inputs":[{"name":"flowtype"}],"output":{"name":"str"}}],[11,"default","","",2,{"inputs":[{"name":"applicationsecret"}],"output":{"name":"applicationsecret"}}],[11,"clone","","",2,{"inputs":[{"name":"applicationsecret"}],"output":{"name":"applicationsecret"}}],[11,"encode","","",2,{"inputs":[{"name":"applicationsecret"},{"name":"__s"}],"output":{"name":"result"}}],[11,"decode","","",2,{"inputs":[{"name":"applicationsecret"},{"name":"__d"}],"output":{"name":"result"}}],[11,"default","","",3,{"inputs":[{"name":"consoleapplicationsecret"}],"output":{"name":"consoleapplicationsecret"}}],[11,"encode","","",3,{"inputs":[{"name":"consoleapplicationsecret"},{"name":"__s"}],"output":{"name":"result"}}],[11,"decode","","",3,{"inputs":[{"name":"consoleapplicationsecret"},{"name":"__d"}],"output":{"name":"result"}}],[11,"default","","",11,{"inputs":[{"name":"nullstorage"}],"output":{"name":"nullstorage"}}],[11,"set","","",11,{"inputs":[{"name":"nullstorage"},{"name":"u64"},{"name":"option"}],"output":null}],[11,"get","","",11,{"inputs":[{"name":"nullstorage"},{"name":"u64"}],"output":{"name":"option"}}],[11,"default","","",4,{"inputs":[{"name":"memorystorage"}],"output":{"name":"memorystorage"}}],[11,"set","","",4,{"inputs":[{"name":"memorystorage"},{"name":"u64"},{"name":"option"}],"output":null}],[11,"get","","",4,{"inputs":[{"name":"memorystorage"},{"name":"u64"}],"output":{"name":"option"}}],[11,"new","","Returns a new `Authenticator` instance",12,{"inputs":[{"name":"authenticator"},{"name":"applicationsecret"},{"name":"d"},{"name":"c"},{"name":"s"},{"name":"option"}],"output":{"name":"authenticator"}}],[11,"token","","Blocks until a token was retrieved from storage, from the server, or until the delegate\ndecided to abort the attempt, or the user decided not to authorize the application.\nIn any failure case, the returned token will be None, otherwise it is guaranteed to be \nvalid for the given scopes.",12,{"inputs":[{"name":"authenticator"},{"name":"i"}],"output":{"name":"option"}}],[11,"api_key","","",12,{"inputs":[{"name":"authenticator"}],"output":{"name":"option"}}],[8,"TokenStorage","","Implements a specialised storage to set and retrieve `Token` instances.\nThe `scope_hash` represents the signature of the scopes for which the given token\nshould be stored or retrieved.",null,null],[10,"set","","If `token` is None, it is invalid or revoked and should be removed from storage.",13,{"inputs":[{"name":"tokenstorage"},{"name":"u64"},{"name":"option"}],"output":null}],[10,"get","","A `None` result indicates that there is no token for the given scope_hash.",13,{"inputs":[{"name":"tokenstorage"},{"name":"u64"}],"output":{"name":"option"}}],[8,"AuthenticatorDelegate","","A partially implemented trait to interact with the `Authenticator`",null,null],[11,"connection_error","","Called whenever there is an HttpError, usually if there are network problems.",14,{"inputs":[{"name":"authenticatordelegate"},{"name":"httperror"}],"output":{"name":"retry"}}],[11,"request_failure","","The server denied the attempt to obtain a request code",14,{"inputs":[{"name":"authenticatordelegate"},{"name":"requestresult"}],"output":null}],[11,"expired","","Called if the request code is expired. You will have to start over in this case.\nThis will be the last call the delegate receives.",14,{"inputs":[{"name":"authenticatordelegate"},{"name":"datetime"}],"output":null}],[11,"denied","","Called if the user denied access. You would have to start over.\nThis will be the last call the delegate receives.",14,{"inputs":[{"name":"authenticatordelegate"}],"output":null}],[11,"pending","","Called as long as we are waiting for the user to authorize us.\nCan be used to print progress information, or decide to time-out.",14,{"inputs":[{"name":"authenticatordelegate"},{"name":"pollinformation"}],"output":{"name":"retry"}}],[11,"present_user_code","","The server has returned a `user_code` which must be shown to the user,\nalong with the `verification_url`.\n# Notes\n* Will be called exactly once, provided we didn't abort during `request_code` phase.\n* Will only be called if the Authenticator's flow_type is `FlowType::Device`.",14,{"inputs":[{"name":"authenticatordelegate"},{"name":"pollinformation"}],"output":null}],[8,"GetToken","","A provider for authorization tokens, yielding tokens valid for a given scope.\nThe `api_key()` method is an alternative in case there are no scopes or\nif no user is involved.",null,null],[10,"token","","",15,{"inputs":[{"name":"gettoken"},{"name":"i"}],"output":{"name":"option"}}],[10,"api_key","","",15,{"inputs":[{"name":"gettoken"}],"output":{"name":"option"}}],[11,"connection_error","","Called whenever there is an HttpError, usually if there are network problems.",14,null],[11,"request_failure","","The server denied the attempt to obtain a request code",14,null],[11,"expired","","Called if the request code is expired. You will have to start over in this case.\nThis will be the last call the delegate receives.",14,null],[11,"denied","","Called if the user denied access. You would have to start over.\nThis will be the last call the delegate receives.",14,null],[11,"pending","","Called as long as we are waiting for the user to authorize us.\nCan be used to print progress information, or decide to time-out.",14,null],[11,"present_user_code","","The server has returned a `user_code` which must be shown to the user,\nalong with the `verification_url`.\n# Notes\n* Will be called exactly once, provided we didn't abort during `request_code` phase.\n* Will only be called if the Authenticator's flow_type is `FlowType::Device`.",14,null]],"paths":[[3,"PollInformation"],[3,"Token"],[3,"ApplicationSecret"],[3,"ConsoleApplicationSecret"],[3,"MemoryStorage"],[4,"PollResult"],[4,"RefreshResult"],[4,"FlowType"],[4,"Retry"],[3,"DeviceFlow"],[3,"RefreshFlow"],[3,"NullStorage"],[3,"Authenticator"],[8,"TokenStorage"],[8,"AuthenticatorDelegate"],[8,"GetToken"]]};
